async function getAll(urlAry, usernameA, tokenB) {
  let result = [];
  let formData = new FormData();

  formData.append('u', usernameA)
  formData.append('t', tokenB)

  for (const [idx, url] of urlAry.entries()) {
    let a = Date.now();
    // console.log(idx, url)
    const res = await timeoutPromise(3000, new Error('Timed Out!'), fetch("https://" + url + "/xping", { method: 'POST', body: formData }).then((response) => {
      return response
    }).catch((err) => {
      console.log("net work error")
      return "error"
    })).catch(() => {
      console.log("net work timeout")
      return "error"
    })

    // console.log("finish")
    let dd = ""
    if (typeof res == "string") {
      dd = res
    } else {
      dd = await res.text();
      // console.log("wait finish text")
    }

    if (dd != "error") {
      let sm = JSON.parse(dd)
      if (sm.c == '200') {
        localStorage.setItem("xHaveMessage", sm.m)
      }
      if (sm.hasOwnProperty('day')) {
        localStorage.setItem("xHaveDay", sm.day)
      }
      result[idx] = { a: (Date.now() - a), b: url, c: dd }
    }
  }
  return await result;
};


