function Pay(encode, callback) {
  let url = GetApi() + "/xords"
  xhr.open("POST", url, true);
  sendData = new FormData();
  sendData.append("u", usernameForLogin);
  sendData.append("t", TokenG);
  sendData.append("s", encode)
  xhr.onreadystatechange = function () {
    if (xhr.readyState == 4) {
      if (xhr.status == 200) {
        var result = JSON.parse(xhr.responseText);
        if (result.c == "1") {
          localStorage.setItem("username", usernameForLogin)
          localStorage.setItem("token", result.data.token)
          localStorage.setItem("xuserInfo", xhr.responseText)
        }
        callback(true, result)
      } else {
        callback(false, "")
      }
    }
  }
  xhr.send(sendData);
}
